We've been keeping a secret from you. We haven't liked it. But it's time for us to come out about the fact that WE'RE MAKING A PODCAST ABOUT MY SO CALLED LIFE! It's called "MY SO-CALLED PODCAST" and you're going to love it. Imagine the format of True Crime Obsessed, but for "My So-Called Life"--all the flannel, floppy hair, drama, under aged drinking, and JORDAN CATALANO! Listen to this teaser and then go wherever you get your podcasts to listen to the full promo! And subscribe! We love you, that's why we're asking you to, like, join us on this journey....or whatever.&#13;
&#13;
You can also stream the promo [here!](https://mysocalledpodcast.todaytix.com/)

